import './style.css';
import '../../styles/form.css';
import { Link } from 'react-router-dom';

function SignIn() {
    return (
      <div className="container-form">
        <form className="form-sign-in">
          <div className="text-center">
            <h1>Entrar</h1>
            <Link to="/sign-up">Cadastre-se</Link>
          </div>
        </form>
      </div>
    );
  }
  export default SignIn;
